CREATE DEFINER=`root`@`localhost` PROCEDURE `spSetUsers`(v_cuantos INT)
BEGIN
	DECLARE i INT DEFAULT 1;
		WHILE i <= v_cuantos DO
			CALL spMkUser();
			SET i=i+1;
		END WHILE;
END ;;
